 <p>**Product Specifications:**</p>
 <p></p>
 <p>**Brand:** COOKER KING</p>
 <p>**Product Name:** Chinese Traditional Iron Wok, Selected High-purity Extreme Iron, Light Oil Iron Wok, Non-coated Healthy Second-generation Extreme Iron Stir-fry Wok</p>
 <p>**Features:**</p>
 <p> - Micro-spiral pattern, thick bottom and thin walls, reduces sticking, even heat conduction</p>
 <p> - Nitrogen, room-temperature iron, flat bottom, SPCC, rust-resistant, versatile for different stoves</p>
 <p> - Second-generation upgrade with 3 major advantages: rust-resistant, high-quality extreme iron, room-temperature iron technology, lightweight and durable</p>
 <p> - Micro-spiral pattern on the wall reduces sticking, enhances heat conduction</p>
 <p> - No coating, suitable for all cooking utensils, easy to clean</p>
 <p>**Product Parameters:**</p>
 <p> - Diameter: 28cm</p>
 <p> - Height: approximately 9.2cm</p>
 <p> - Handle length: approximately 20.5cm</p>
 <p> - Base diameter: approximately 14cm</p>
 <p>**Material:** SPCC</p>
 <p>**Model Number:** BZ50526</p>
 <p>**Capacity:** Suitable for 1-3 people</p>
 <p>**Weight:** Wok approximately 1.20kg, Lid approximately 0.7kg</p>
 <p>**Compatible Stoves:** Suitable for common stoves such as electric ceramic stoves, electric stoves, halogen stoves, gas stoves, and induction cookers</p>
 <p>**Product Details:**</p>
 <p> - Iron body with room-temperature iron technology for rust resistance</p>
 <p> - Exquisite logo, selected ash wood handle for comfortable grip and heat insulation</p>
 <p> - Four rivets for reinforcement, stable and durable handle</p>
 <p> - Wide flat bottom for magnetic conduction and heat conduction</p>
 <p>**New Wok Use and Maintenance:**</p>
 <p> - **Seasoning New Wok:**</p>
 <p> 1. Clean the wok with warm water and a soft brush, then heat it on the stove.</p>
 <p> 2. Rub the inner wall with ginger or fat to evenly coat it with oil.</p>
 <p> 3. Rinse with hot water, dry on low heat, and wipe with oil.</p>
 <p> 4. Wash with water and dry to complete the seasoning process.</p>
 <p> - **Maintenance Tips:**</p>
 <p> 1. Heat the new wok on low heat and apply a thin layer of edible oil after each use.</p>
 <p> 2. Clean with a soft brush and warm water, avoid steel wool and detergents.</p>
 <p> 3. If rust or burnt residue occurs, repeat the seasoning process.</p>
 <p> 4. The iron wok will develop a protective layer with use, enhancing its performance.</p>
 <p> 5. Compatible with various cooking utensils due to the lack of coating.</p>
 <p></p>
 <p>*Note: Product dimensions are manually measured with a tolerance of approximately +1cm. Weight may vary by around 0.2kg. Please refer to the actual product for accurate information.*</p>
