 <p>**Specifications:**</p>
 <p></p>
 <p>**Brand:** JBL</p>
 <p>**Model:** FLIP 6</p>
 <p>**Description:** All-weather portable speaker with high-quality sound and stylish design. Features IP67 protection, allowing it to withstand dust, rain, and even complete submersion in water. Suitable for indoor and outdoor use. Meets IP6X standard for dust protection and IPX7 standard for water resistance.</p>
 <p>**Bluetooth:** Bluetooth 5.1 technology for fast and stable connectivity with low power consumption and high-quality audio streaming. Can connect to two audio sources simultaneously.</p>
 <p>**Eco-friendly:** Made with recyclable materials and soy ink printing for a safer and more environmentally friendly product.</p>
 <p>**Technical Specifications:**</p>
 <p> - Transducer: 4580mm woofer / 1.753", 16mm tweeter / 0.6"</p>
 <p> - Output Power: 20W RMS (woofer), 10W RMS (tweeter)</p>
 <p> - Frequency Response: 63Hz-20kHz</p>
 <p> - Signal-to-Noise Ratio: &gt;80 dB</p>
 <p> - Battery Type: Lithium-ion 17.28Wh (equivalent to 3.6V/4800mAh)</p>
 <p> - Battery Charging Time: 2.5 hours (5V/3A)</p>
 <p> - Music Playtime: Up to 12 hours (depending on volume and audio content)</p>
 <p> - Cable Type: USB-C charging cable, Cable Length: 1.2m / 47.2"</p>
 <p> - Maximum Operating Temperature: 45C</p>
 <p>**Wireless Specifications:**</p>
 <p> - Bluetooth Version: 5.1</p>
 <p> - Bluetooth Profiles: A2DP 1.3, AVRCP 1.6</p>
 <p> - Bluetooth Frequency Range: 2400 MHz-2483.5 MHz</p>
 <p> - Bluetooth Power: 10 dBm (EIRP)</p>
 <p> - Bluetooth Modulation: GFSK, /4DQPSK, 8DPSK</p>
 <p> - 2.4GHz SRD Frequency Range: 2407 MHz - 2475 MHz</p>
 <p> - SRD Transmitter Power: &lt;10dBm (EIRP)</p>
 <p>**Product Dimensions:**</p>
 <p> - Dimensions (W x H x D): 178 x 68 x 72 mm / 7.0 x 2.6 x 2.8"</p>
 <p> - Net Weight: 0.55 kg / 1.21 lbs</p>
 <p>**Package Contents:**</p>
 <p> - 1 x JBL FLIP 6 Speaker</p>
 <p> - 1 x USB-C Cable</p>
 <p> - 1 x Warranty Card</p>
 <p> - 1 x Quick Start Guide</p>
 <p> - 1 x Warranty Card/Safety Data Sheet</p>
</div>
