insert into "Products" ("Id", "ExternalId", "Name", "Description", "MainImage", "Quantity", "Price", "PublishStatus", "CreatedAt", "UpdatedAt", "DeletedAt", "CreatedById", "UpdatedById", "DeletedById", "Images", "CategoryId", "Height", "Length", "Weight", "Width", "AdditionalCost") values ('a83b9afe-91a7-4e4a-9278-51b8ad234d8e', '100043547804', 'SUPOR Electric Grain Mill and Food Processor Multi-functional Grinder Dry Powder Machine Whole Grains and Cereals Crusher Large Capacity Fine Grinding Machine SMF2004', '<div class="jdipp" name="jdipp">
 <p>**Product Specifications:**</p>
 <p></p>
 <p>**Brand:** SUPOR</p>
 <p>**Model:** SMF2004</p>
 <p>**Color:** Moon White</p>
 <p>**Power:** 500W</p>
 <p>**Material:** SUS304+SUS301</p>
 <p>**Size:** 19*16*30CM</p>
 <p>**Voltage:** 220V</p>
 <p>**Capacity:** 300g</p>
 <p>**Control Method:** Rotary Switch</p>
 <p>**Features:** Large capacity of 300g, finely ground for delicate texture, high-speed grinding at 20000 rpm, 3-speed settings for personalized grinding, stainless steel grinding cup, dual stainless steel blades for efficient grinding, stable base with suction cups, transparent lid for easy monitoring, safety lock to prevent splashing.</p>
 <p>**Usage:** Suitable for grinding a variety of ingredients such as soybeans, mung beans, rice, ginseng, star anise, rock sugar, chili, Tianqi, shiitake mushrooms, and peppercorns.</p>
 <p>**Application:** Ideal for making fine powders from various ingredients for cooking and nutrition supplements.</p>
 <p>**Note:** The speed of 20000 rpm is the unloaded speed. Actual speed may vary based on the selected function and food load.</p>
 <p></p>
 <p>This SUPOR grinder, SMF2004, with its powerful 500W motor and high-speed grinding capabilities, offers precise and uniform grinding results for a wide range of ingredients. Its durable stainless steel construction and versatile 3-speed settings make it a reliable and efficient kitchen appliance for grinding various foods into fine powders.</p>
</div>
