 <p>**Product Specifications:**</p>
 <p></p>
 <p>**Brand:** CAXMAN</p>
 <p>**Model:** 3001</p>
 <p>**Lens Material:** TAC polarized</p>
 <p>**Frame Material:** Aluminum-magnesium alloy</p>
 <p>**Weight:** 25g</p>
 <p>**Gender:** Men</p>
 <p>**Dimensions:** 66mm (lens width), 13mm (bridge width), 66mm (lens height), 40mm (frame width), 147mm (temple length)</p>
 <p>**Color Options:** Gunmetal frame with gray lenses (back coated with AR), Black frame with green lenses</p>
 <p></p>
 <p>**Features:**</p>
 <p>Lightweight aluminum-magnesium frame</p>
 <p>Comfortable fit with dual-color temple tips</p>
 <p>Polarized lenses for clear vision and reduced glare</p>
 <p>Back coated with AR film</p>
 <p>Adjustable silicone nose pads for a secure and customized fit</p>
 <p></p>
 <p>**Additional Information:**</p>
 <p>Designed for driving and cycling, providing both style and functionality</p>
 <p>Designed by CaxmanMake with a focus on bold and unrestrained personality</p>
 <p>Manufactured by CAXMAN, a brand under the Cheyi Group with 27 years of experience in eyewear production</p>
 <p>Cheyi Group specializes in the development, design, manufacturing, and marketing of various eyewear products, ensuring a blend of fashion, affordability, and quality</p>
 <p></p>
 <p>**Quality Assurance:**</p>
 <p>Tested and approved by Xiamen Product Quality Supervision and Inspection Institute</p>
 <p>Meets standards for lens curvature, prism deviation, light transmission, UV protection, and color accuracy</p>
 <p></p>
 <p>**Design Philosophy:**</p>
 <p>CAXMAN eyewear reflects a strong and pure attitude, emphasizing inner strength over external adornment</p>
 <p>Each design is a manifestation of the designer''s inner emotions and desires for authenticity</p>
 <p></p>
 <p>**Company Overview:**</p>
 <p>Cheyi Group, founded in 1978 in Tainan, Taiwan, expanded to Xiamen in 1990</p>
 <p>Specializes in the research, design, manufacturing, and marketing of various eyewear products</p>
 <p>Focuses on fashion, affordability, and quality to provide a comfortable eyewear experience</p>
 <p>Operates under the umbrella of CAXMAN, a subsidiary of Cheyi Group, which has pioneered a new model of eyewear enterprise development</p>
 <p></p>
 <p>(Note: The specifications are based on the provided information and may be subject to change or verification.)</p>
