 <p>Product Specifications:</p>
 <p></p>
 <p>Brand: Compas</p>
 <p>Model: WD877</p>
 <p>Product Name: Smart Electronic Alarm Clock</p>
 <p>EE: 9, 3=/, 2, 27, 12-00</p>
 <p>Features:</p>
 <p>Learning and life assistant</p>
 <p>Light-sensitive screen</p>
 <p>Talking Clock</p>
 <p>Three alarm clocks</p>
 <p>Musical alarm</p>
 <p>Temperature display</p>
 <p>Date display</p>
 <p>12/24 hour time format</p>
 <p>Snooze function</p>
 <p>Time switching</p>
 <p>Battery powered (3 x AAA carbon batteries)</p>
 <p>Automatic backlight in low light conditions</p>
 <p>Voice time reporting</p>
 <p>Single/double rest alarm setting</p>
 <p>Five color options: black, white, blue, pink, green</p>
 <p>Product dimensions: 135*45*75 (MM)</p>
 <p></p>
 <p>The Compas WD877 Smart Electronic Alarm Clock is a versatile device designed to assist with learning and daily life. It features a light-sensitive screen with automatic backlighting in low light conditions, making it easy to read the time at night. The clock offers three alarm settings, a musical alarm option, and temperature and date displays. It operates on 3 AAA carbon batteries and also includes a snooze function for comfortable waking up. Additionally, it provides voice time reporting and the option to set single or double rest alarms, making it suitable for both workdays and weekends. With its compact size and multiple color options, this alarm clock is a stylish and practical addition to any home.</p>
