 <p>Product Specifications</p>
 <p></p>
 <p>Brand: ZIPPO</p>
 <p>Model: LH8132</p>
 <p>Frame Material: Stainless Steel</p>
 <p>Lens Material: Anti-blue light resin lens</p>
 <p>Gender: Unisex</p>
 <p>Net Weight: 8.8g (excluding lenses)</p>
 <p>Frame Height: 37mm</p>
 <p>Temple Length: 140mm</p>
 <p>Bridge Width: 18mm</p>
 <p>Total Width: 141mm</p>
 <p>Lens Width: 54mm</p>
 <p></p>
 <p>Features:</p>
 <p>Progressive multifocal lenses for both near and distance vision</p>
 <p>Vacuum IP plating for durable and stable color</p>
 <p>High-efficiency blue light protection, blocking 67.8% of harmful blue light (380NM~500NM)</p>
 <p>Lens transmittance rate of 89.9% (380NM~780NM)</p>
 <p>Imported high-transmittance, waterproof, and oil-proof lens material</p>
 <p>Gravity reinforcement design for the temple tips, ensuring a secure fit</p>
 <p>Combination reinforced hinges for smooth opening and closing without pinching</p>
 <p>Soft silicone non-slip nose pads with custom logo core</p>
 <p></p>
 <p>Product Packaging:</p>
 <p>Each pair of glasses comes with two random styles of glasses cases</p>
 <p>*The card is for photographic purposes only</p>
 <p></p>
 <p>Brand History:</p>
 <p>ZIPPO was founded in 1932 by Mr. George G. Blaisdell in Bradford, Pennsylvania, USA. For over 90 years, ZIPPO has adhered to the core values of "simplicity, durability, and practicality." With a relentless pursuit of product craftsmanship, ZIPPO continues to provide reliable product experiences.</p>
 <p></p>
 <p>Usage Tips:</p>
 <p>Not suitable for driving or walking</p>
 <p>Avoid contact with chemical solvents and sharp objects</p>
 <p>Do not store in high temperatures</p>
 <p>Only for near and reading use</p>
 <p>Clean with flowing water and neutral detergent</p>
 <p>Do not use alcohol, organic solvents, or acidic and alkaline solvents to clean the lenses</p>
 <p>Store with the convex side up when not wearing</p>
 <p>Avoid high-temperature exposure and store in a dry, ventilated, and cool environment</p>
 <p>Use both hands to put on and take off</p>
 <p></p>
 <p>Guarantee:</p>
 <p>7-day no-reason return and exchange, 1-year quality assurance</p>
 <p>Lightning delivery by JD Logistics</p>
 <p>Quality assurance for 365 days</p>
